import React, { useEffect, useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

function SVARPage() {
  const [svArData, setSvArData] = useState([]);
  const [svHistory, setSvHistory] = useState([]);
  const [showHistory, setShowHistory] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      const userEmail = localStorage.getItem('userEmail');
      if (!userEmail) {
        navigate('/');
        return;
      }

      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setSvArData(result.violationsData || []);
        setSvHistory(result.svHistory || []);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  return (
    <div style={{ display: "flex", minHeight: "100vh", fontFamily: "Arial, sans-serif" }}>
      {/* Sidebar */}
      <div style={{ backgroundColor: "#d32f2f", color: "#fff", width: "220px", padding: "20px" }}>
        <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ width: "180px", marginBottom: "20px" }} />
        <nav>
          <ul style={{ listStyle: "none", padding: 0, display: "flex", flexDirection: "column", gap: "10px" }}>
            <li>
              <Link to="/dashboard" style={{
                display: "block",
                backgroundColor: "#fff",
                color: "#d32f2f",
                textDecoration: "none",
                padding: "10px",
                borderRadius: "5px",
                textAlign: "center",
                fontWeight: "bold"
              }}>
                Dashboard
              </Link>
            </li>
            <li>
              <Link to="/sv-ar" style={{
                display: "block",
                backgroundColor: "#fff",
                color: "#d32f2f",
                textDecoration: "none",
                padding: "10px",
                borderRadius: "5px",
                textAlign: "center",
                fontWeight: "bold"
              }}>
                Current SV & AR
              </Link>
            </li>
          </ul>
        </nav>
        <button onClick={handleLogout} style={{
          marginTop: "20px",
          backgroundColor: "#fff",
          color: "#d32f2f",
          border: "none",
          padding: "10px",
          cursor: "pointer",
          borderRadius: "5px",
          width: "100%",
          fontWeight: "bold"
        }}>
          Logout
        </button>
      </div>

      {/* Main Content */}
      <div style={{ flex: 1, backgroundColor: "#f9f9f9", padding: "20px" }}>
        <h2 style={{ color: "#d32f2f" }}>Current Scanning Violations & ARs</h2>
        {svArData.length === 0 && <p>No current scanning violations or ARs found.</p>}
        {svArData.map((item, index) => (
          <div key={index} style={{ marginBottom: "10px", backgroundColor: "#fff", padding: "10px", borderRadius: "5px", boxShadow: "0 0 3px rgba(0,0,0,0.1)" }}>
            {Object.entries(item).map(([key, value]) => (
              <div key={key}><strong>{key}:</strong> {value || "N/A"}</div>
            ))}
          </div>
        ))}

        <button onClick={() => setShowHistory(!showHistory)} style={{
          backgroundColor: "#d32f2f",
          color: "#fff",
          border: "none",
          padding: "10px 20px",
          cursor: "pointer",
          borderRadius: "5px",
          marginTop: "20px",
          fontWeight: "bold"
        }}>
          {showHistory ? "Hide SV & AR History" : "Show SV & AR History"}
        </button>

        {showHistory && (
          <div style={{ marginTop: "20px" }}>
            <h3 style={{ color: "#d32f2f" }}>SV & AR History</h3>
            {svHistory.length === 0 && <p>No SV & AR history available.</p>}
            {svHistory.map((item, index) => (
              <div key={index} style={{ marginBottom: "10px", backgroundColor: "#fff", padding: "10px", borderRadius: "5px", boxShadow: "0 0 3px rgba(0,0,0,0.1)" }}>
                {Object.entries(item).map(([key, value]) => (
                  <div key={key}><strong>{key}:</strong> {value || "N/A"}</div>
                ))}
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default SVARPage;
